import './App.css';
import React, { useState } from "react";
import Axios from 'axios';
import { BrowserRouter as Router,Route,Routes,link } from "react-router-dom";
import frontmain from "./frontmain"

function App() {



  const [post, setPost] = useState({});
  const [resumeid, id1] = useState('');
  const [resumename, name1] = useState('');
  const [resumeus, usn] = useState('');
  const [resumehdeg, hdeg] = useState('');
  const [resumejtype, jtype] = useState('');
  const [resumejdic, jdisc] = useState('');
  const [resumesslcp, sslcp] = useState('');
  const [resumesslcins, sslcins] = useState('');
  const [resumepucp, pucp] = useState('');
  const [resumepuci, puci] = useState('');
  const [resumedeg, deg] = useState('');
  const [resumedegp, degp] = useState('');
  const [resumedegi, degi] = useState('');

  const submitReview = () => {
    Axios.post("http://localhost:3001/postt", {
      resumename: resumename,
      resumeus: resumeus,
      resumehdeg: resumehdeg,
      resumejtype: resumejtype,
      resumejdic: resumejdic,
      resumesslcp: resumesslcp,
      resumesslcins: resumesslcins,
      resumepucp: resumepucp,
      resumepuci: resumepuci,
      resumedeg: resumedeg,
      resumedegp: resumedegp,
      resumedegi: resumedegi,

    }).then(() => {
      alert("sucessfully inserted")
    });
  };


  const submitReview1 = () => {
    Axios.post("http://localhost:3001/api", {
      resumeid: resumeid,
    }).then((response) => {
      console.log(response);
    });
  };

  return (


    <Route
  path="/song/:songId/edit"
  element={<EditSong />}
  action={async ({ params, request }) => {
    let formData = await request.formData();
    return fakeUpdateSong(params.songId, formData);
  }}
  loader={({ params }) => {
    return fakeGetSong(params.songId);
  }}
/>)

return (
    <div class="context">
      <div class="area">
        <div >
        </div>
        <div class="area">
          <ul class="circles">
            <li></li>
            <li></li>
            <li></li>
            <li></li>
            <li></li>
            <li></li>
            <li></li>
            <li></li>
            <li></li>
            <li></li>
          </ul>
        </div >
        <div class="circles"><h1>RESUME BUILDER</h1><div>
          <br /><label>ENTER USN TO FETCH RESUME</label><a href="client/resume/src/home.css">click</a>
          <input type="text" name="id1" class="form-input basic round" onChange={(e) => {
            id1(e.target.value)
          }} /> <br />
            <button onClick={submitReview1}>SUBMIT</button>
        </div>
          <form><tbody>
            <tr><td>
            </td><td></td></tr>
            <tr><td>
              <label>USN</label></td><td>
                <input type="text" name="usn" class="form-input basic round" onChange={(e) => {
                  usn(e.target.value)
                }} /></td></tr>
            <tr><td>
              <label>NAME</label></td><td>
                <input type="text" name="name1" class="form-input basic round" onChange={(e) => {
                  name1(e.target.value)
                }} /></td></tr><tr><td>
                  <label>HIGHEST DEGREE</label></td><td>
                <input type="text" name="hdeg" class="form-input basic round" onChange={(e) => {
                  hdeg(e.target.value)
                }} /></td></tr>
            <tr><td>
              <label>JOB TYPE</label></td><td>
                <input type="text" name="jtype" class="form-input basic round" onChange={(e) => {
                  jtype(e.target.value)
                }} /></td></tr>
            <tr><td>
              <label>JOB DISCRIPTION</label></td><td>
                <input type="text" name="jdisc" class="form-input basic round" onChange={(e) => {
                  jdisc(e.target.value)
                }} /></td></tr>
            <tr><td>
              <label>SSLC PERCENTAGE</label></td><td>
                <input type="text" name="sslcp" class="form-input basic round" onChange={(e) => {
                  sslcp(e.target.value)
                }} /></td></tr>
            <tr><td>
              <label>SSLC INSTITUTION</label></td><td>
                <input type="text" name="sslcins" class="form-input basic round" onChange={(e) => {
                  sslcins(e.target.value)
                }} /></td></tr>
            <tr><td>
              <label>PUC PERCENTAGE</label></td><td>
                <input type="text" name="pucp" class="form-input basic round" onChange={(e) => {
                  pucp(e.target.value)
                }} /></td></tr>
            <tr><td>
              <label>PUC INSTITUTION</label></td><td>

                <input type="text" name="puci" class="form-input basic round" onChange={(e) => {
                  puci(e.target.value)
                }} /></td></tr>
            <tr><td>
              <label>DEGREE</label></td><td>
                <input type="text" name="deg" class="form-input basic round" onChange={(e) => {
                  deg(e.target.value)
                }} /></td></tr>
            <tr><td>
              <label>DEGREE PERCENTAGE</label></td><td>
                <input type="text" name="degp" class="form-input basic round" onChange={(e) => {
                  degp(e.target.value)
                }} /></td></tr>
            <tr><td>
              <label>DEGREE INSTITUTION</label></td><td>

                <input type="text" name="degi" class="form-input basic round" onChange={(e) => {
                  degi(e.target.value)
                }} /></td></tr></tbody>
            <button onClick={submitReview}>SUBMIT
            </button></form><br />
        </div>
      </div>
    </div>
  );
}

export default App;
